import { useCookies } from "react-cookie";
import { useNavigate } from "react-router-dom";
import { useEffect,useState } from "react";
import axios from "axios";

function Home(){
    const [cookies, setCookie] = useCookies();
    const [name,setName] = useState("");
    const navigate = useNavigate();
    useEffect(()=>{
        if(cookies.username===undefined) {
            navigate('/');
        }
        axios.get('http://localhost:4000/authenticate',{ headers: {"Authorization" : `Bearer ${cookies.username}`}}).then(response=>{
            console.log(response);
        }).catch(err=>{
            navigate("/");
        })
    },[cookies.username]);

    useEffect(()=>{
        fetch('http://localhost:4000/getartists',{
            method : "POST",
            headers : {'Content-Type' : 'Application/'}
        });
    },[name]);

    return <div>
        <input placeholder="Type Name" onChange={(e)=>{setName(e.target.value)}}></input>
    </div>
}

export default Home;
